import React from 'react';
import { Link } from 'react-router-dom';

const TabAuth = () => {
  return (
    <div style={{ display: 'flex' }}>
      <p style={{ marginRight: '10px' }}>Регистрация</p>
      <Link to="/login">Авторизация</Link>
    </div>
  );
};

export default TabAuth;
